import React from 'react';
import { Link } from 'react-router-dom';

function TrackOrders() {
    return (
        <div>
            <h1>Track Orders</h1>
            <p>Here you can track the status of your orders.</p>
            <ul>
                <li>
                    <Link to="/admin/orders/123">Order #123</Link>
                </li>
                <li>
                    <Link to="/admin/orders/456">Order #456</Link>
                </li>
                <li>
                    <Link to="/admin/orders/789">Order #789</Link>
                </li>
            </ul>
        </div>
    );
}

export default TrackOrders;
